import React, { Component } from 'react'

class Todo extends Component {
  constructor(){
    super();
    this.state = {
      name: '',
      time_to_complete: '',
      level_of_difficulty: ''
    }
  }

  render() {
    return(
      <li><input type="checkbox" onChange={this.props.updateTodo()} />{props.props.name}</li>
    )
  }

}

export default Todo;
